import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { api } from '../services/api';
import './ResultsPage.css';

const ResultsPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const [sampleBill, setSampleBill] = useState(null);
  const [loadingSample, setLoadingSample] = useState(false);
  
  // Get result data from navigation state
  const { result, imageUrl, mode } = location.state || {};
  
  // Load a sample bill for comparison
  useEffect(() => {
    if (result) {
      loadSampleBill();
    }
  }, [result]);

  const loadSampleBill = async () => {
    try {
      setLoadingSample(true);
      const response = await api.get('/sample-bills');
      if (response.data.samples && response.data.samples.length > 0) {
        // Get a random sample bill for comparison
        const randomIndex = Math.floor(Math.random() * response.data.samples.length);
        setSampleBill(response.data.samples[randomIndex]);
      }
    } catch (error) {
      console.error('Error loading sample bill:', error);
    } finally {
      setLoadingSample(false);
    }
  };
  
  // Redirect to scan page if no data
  if (!result) {
    navigate('/scan');
    return null;
  }
  
  const isAuthentic = result.result?.authentic;
  const confidence = Math.round(result.result?.confidence || 0);
  const denomination = result.result?.denomination;
  const processingTime = result.processing_time?.toFixed(2);
  const features = result.result?.features || {};

  const handleNewScan = () => {
    navigate('/scan');
  };

  const handleSaveToHistory = () => {
    // Save to local storage for now (in production, this would save to backend)
    const existingHistory = JSON.parse(localStorage.getItem('pesoscan_history') || '[]');
    const scanRecord = {
      id: result.id || Date.now().toString(),
      timestamp: result.timestamp || new Date().toISOString(),
      result: result.result,
      imageUrl: imageUrl,
      mode: mode,
      processingTime: result.processing_time
    };
    
    existingHistory.unshift(scanRecord); // Add to beginning
    localStorage.setItem('pesoscan_history', JSON.stringify(existingHistory.slice(0, 50))); // Keep last 50
    
    alert('Scan saved to history!');
  };

  return (
    <div className="results-page">
      <div className="container">
        <div className="results-header">
          <h1>Scan Results</h1>
          <p>Analysis completed in {processingTime || '1.2'}s</p>
        </div>

        <div className="results-content">
          <div className="result-card">
            <div className="result-main">
              <div className={`result-status ${isAuthentic ? 'authentic' : 'counterfeit'}`}>
                <div className="status-icon">
                  {isAuthentic ? (
                    <svg width="64" height="64" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                      <path d="M9 12l2 2 4-4" stroke="currentColor" strokeWidth="3" strokeLinecap="round" strokeLinejoin="round"/>
                      <circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2" fill="none"/>
                    </svg>
                  ) : (
                    <svg width="64" height="64" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                      <circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2" fill="none"/>
                      <line x1="15" y1="9" x2="9" y2="15" stroke="currentColor" strokeWidth="3"/>
                      <line x1="9" y1="9" x2="15" y2="15" stroke="currentColor" strokeWidth="3"/>
                    </svg>
                  )}
                </div>
                
                <h2 className="status-text">
                  {isAuthentic ? 'Authentic' : 'Counterfeit'}
                </h2>
                
                <div className="confidence-score">
                  <span className="confidence-label">Confidence:</span>
                  <span className="confidence-value">{confidence}%</span>
                </div>
                
                {denomination && (
                  <div className="denomination">
                    <span className="denomination-label">Detected:</span>
                    <span className="denomination-value">â‚±{denomination} Peso Bill</span>
                  </div>
                )}
              </div>
            </div>

            <div className="result-details">
              <div className="image-section">
                <h3>Analyzed Image</h3>
                <div className="analyzed-image">
                  <img src={imageUrl} alt="Analyzed peso bill" />
                  {result.result?.detection?.bbox && (
                    <div 
                      className="detection-box"
                      style={{
                        left: `${result.result.detection.bbox[0] * 100}%`,
                        top: `${result.result.detection.bbox[1] * 100}%`,
                        width: `${(result.result.detection.bbox[2] - result.result.detection.bbox[0]) * 100}%`,
                        height: `${(result.result.detection.bbox[3] - result.result.detection.bbox[1]) * 100}%`,
                      }}
                    />
                  )}
                </div>
                <p className="scan-method">
                  Method: {mode === 'camera' ? 'Camera Scan' : 'File Upload'}
                </p>
              </div>

              {/* Detection Information */}
              <div className="detection-section">
                <h3>Detection Details</h3>
                <div className="detection-info">
                  {result.result?.detection ? (
                    <div className="detection-details">
                      <div className="detection-item">
                        <span className="label">Detected Class:</span>
                        <span className="value">{result.result.detection.class_name || 'Philippine Peso'}</span>
                      </div>
                      <div className="detection-item">
                        <span className="label">Detection Confidence:</span>
                        <span className="value">{(result.result.detection.confidence * 100).toFixed(1)}%</span>
                      </div>
                      <div className="detection-item">
                        <span className="label">Location:</span>
                        <span className="value">
                          {result.result.detection.bbox ? 
                            `Found at (${(result.result.detection.bbox[0] * 100).toFixed(0)}%, ${(result.result.detection.bbox[1] * 100).toFixed(0)}%)` : 
                            'Full image'
                          }
                        </span>
                      </div>
                    </div>
                  ) : (
                    <div className="no-detection">
                      <span className="placeholder-icon">ï¿½</span>
                      <p>No specific bill detected</p>
                      <p className="sub-text">Image analyzed as general peso bill</p>
                    </div>
                  )}
                </div>
                <div className="model-info">
                  <p className="model-text">
                    <span className="model-icon">ðŸ¤–</span>
                    Analyzed using YOLOv8 + CNN trained on Philippine peso dataset
                  </p>
                </div>
              </div>

              <div className="features-section">
                <h3>Security Features Analysis</h3>
                <div className="features-grid">
                  <div className={`feature-item ${features.security_thread ? 'detected' : 'not-detected'}`}>
                    <div className="feature-icon">
                      {features.security_thread ? 'âœ“' : 'âœ—'}
                    </div>
                    <div className="feature-info">
                      <span className="feature-name">Security Thread</span>
                      <span className="feature-status">
                        {features.security_thread ? 'Detected' : 'Not Detected'}
                      </span>
                    </div>
                  </div>

                  <div className={`feature-item ${features.watermark ? 'detected' : 'not-detected'}`}>
                    <div className="feature-icon">
                      {features.watermark ? 'âœ“' : 'âœ—'}
                    </div>
                    <div className="feature-info">
                      <span className="feature-name">Watermark</span>
                      <span className="feature-status">
                        {features.watermark ? 'Detected' : 'Not Detected'}
                      </span>
                    </div>
                  </div>

                  <div className={`feature-item ${features.microprinting ? 'detected' : 'not-detected'}`}>
                    <div className="feature-icon">
                      {features.microprinting ? 'âœ“' : 'âœ—'}
                    </div>
                    <div className="feature-info">
                      <span className="feature-name">Microprinting</span>
                      <span className="feature-status">
                        {features.microprinting ? 'Detected' : 'Not Detected'}
                      </span>
                    </div>
                  </div>

                  <div className={`feature-item ${features.color_changing_ink ? 'detected' : 'not-detected'}`}>
                    <div className="feature-icon">
                      {features.color_changing_ink ? 'âœ“' : 'âœ—'}
                    </div>
                    <div className="feature-info">
                      <span className="feature-name">Color-Changing Ink</span>
                      <span className="feature-status">
                        {features.color_changing_ink ? 'Detected' : 'Not Detected'}
                      </span>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div className="results-actions">
          <button onClick={handleNewScan} className="btn btn-primary btn-large">
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M23 19a2 2 0 0 1-2 2H3a2 2 0 0 1-2-2V8a2 2 0 0 1 2-2h4l2-3h6l2 3h4a2 2 0 0 1 2 2z" stroke="currentColor" strokeWidth="2" fill="none"/>
              <circle cx="12" cy="13" r="4" stroke="currentColor" strokeWidth="2" fill="none"/>
            </svg>
            Scan Another Bill
          </button>
          
          <button onClick={handleSaveToHistory} className="btn btn-secondary">
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M19 21l-7-5-7 5V5a2 2 0 0 1 2-2h10a2 2 0 0 1 2 2z" stroke="currentColor" strokeWidth="2" fill="none"/>
            </svg>
            Save to History
          </button>
        </div>

        <div className="disclaimer-section">
          <div className="disclaimer-card">
            <h4>Important Disclaimer</h4>
            <p>
              This system is designed for educational and research purposes. 
              While our AI model strives for high accuracy, it should not be used as the sole method 
              for currency authentication in critical financial decisions. 
              Always verify suspicious bills through official banking channels and trained professionals.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ResultsPage;
